import 'bootstrap/dist/css/bootstrap.css';
import { ListeJeux, FiltreJeux } from './components';
import './index.scss';

class App extends Component{

  render(){
    return (
      <div className="recherche row">
        <ListeJeux />
        <FiltreJeux />
      </div>
    );
  }
}
export default App;
